		aliceKeyAgree.doPhase(bobPubKey, true);
		byte[] sharedSecret = aliceKeyAgree.generateSecret();
		java.lang.System.out.println("shared secret:\n" + toHexString(sharedSecret));
		if (sharedSecret.length != 128) {
			throw new java.lang.Exception("Unexpected shared secret length");
		}
		if (sharedSecret[0] != 0) {
			throw new java.lang.Exception("First byte is not zero as expected");
		}
		aliceKeyAgree.init(alicePrivKey);
		aliceKeyAgree.doPhase(bobPubKey, true);
		byte[] tlsPremasterSecret = aliceKeyAgree.generateSecret("TlsPremasterSecret").getEncoded();
		java.lang.System.out.println("tls premaster secret:\n" + toHexString(tlsPremasterSecret));
		if (tlsPremasterSecret.length != 127) {
			throw new java.lang.Exception("Unexpected TLS premaster secret length");
		}
		if (tlsPremasterSecret[0] == 0) {
			throw new java.lang.Exception("First byte is zero");
		}
		for (int i = 0; i < tlsPremasterSecret.length; i++) {
			if (tlsPremasterSecret[i] != sharedSecret[i + 1]) {
				throw new java.lang.Exception("Shared secrets differ");
			}
		}
